import React from 'react';
import {connect} from 'react-redux';
import FeedHeader from '../../components/FeedHeader';
import './index.css';
import FeedSearchBar from '../../components/FeedSearchBar';
import FeedBody from '../../components/FeedBody';
import FeedBodyLike from '../../components/FeedBodyLike';
import FeedBodyFollow from '../../components/FeedBodyFollow';
import FeedBodyFriend from '../../components/FeedBodyFriend';

function Feed(props) {    

    const switchView = (props) => {
        switch(props.FeedReducer.currentFeedState) 
        {
          case "POST_ALL":   return  <FeedBody/>;

          case "POST_LIKE" | "POST_FRIEND" | "POST_FOLLOW":   return   <FeedBodyLike />;
         // case "POST_FRIEND":   return <FeedBodyLike />;
         // case "POST_FOLLOW":   return <FeedBodyLike />;
          default:      return   <FeedBody />;
        }
      }

        return(
            <main className="feed" id="feed_body">
                <FeedHeader/>
                <FeedSearchBar/>
                { switchView(props) }
             </main>
            )
        }

const mapStateToProps = state => {
                return {
                  ...state,        
                  };
                };   

export default connect(mapStateToProps)(Feed);
